import React from 'react';
import {createRoot} from "react-dom/client"
import App from "./App";
import DynamicScrollToTop  from "./DynamicScrollToTop";

const root = createRoot(document.getElementById("root"));

root.render(
       <React.StrictMode>
          <DynamicScrollToTop/> 
         <App />
         <DynamicScrollToTop/> 
      </React.StrictMode>
);
